import './App.css';
import Navbar from './component/Navbar';

function App() {
  return (
  <>  
    <Navbar/>

    <Routes>
      <Route path='/' element={<Home/>}></Route>
      <Route path='/addProduct' element={<Home/>}></Route>
    </Routes>
  </>  
  );
}

export default App;
